import styled, { createGlobalStyle } from 'styled-components';
import { GlobalStyleComponent } from 'styled-components';

export const GlobalCSs = createGlobalStyle`
  *{
    padding: 0;
    margin: 0;
    }

`;

export const Header = styled.header`
    width: 100%;
    height: 80px;
    background-color: black;
`;
